import React from 'react';
import BBA from './components/BBA';
import Dac from './components/Dac';
import JFK from './components/JFK';
import Total from './components/Total';
import Navbar from './hidden_components/Navbar';

const App = () => {
  return (
    <>
      <div className=''>
        <div>
          <BBA />
        </div>

        <div>
          <Dac />
        </div>

        <div></div>
        <div>
          <JFK />
        </div>

        <div>
          <Total />
        </div>
      </div>

      <div>
        <Navbar />
      </div>
    </>
  );
};

export default App;
